<!DOCTYPE html>
<html dir="ltr" lang="en">

<head>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1.0, maximum-scale=5.0">
  <title>KCLSU Components</title>

  <!--Fonts-->
  <link rel="stylesheet" href="https://use.typekit.net/mgu1jus.css">


  <script type="module" src="/build/kclsu-components.esm.js"></script>
  <script nomodule src="/build/kclsu-components.js"></script>

</head>

<body>

  <elections-candidates results electionid="149" >
    <elections-tab 
        tabtitle="Student Officers"
        combineresults="true" 
        posts="Vice President Education (Health) (full time, paid) | Vice President Activities & Development (full-time, paid) | Vice President Education (Arts & Sciences) (full time, paid) | Vice President Welfare & Community (full-time, paid) | President (full-time, paid) | Vice President Postgraduate (full-time, paid)"  
        type="multiple" 
        active
        regex="\(full-time, paid\) | \(full time, paid\) | Vice-President | Vice President"
        replace=" |  | VP | VP"
        ></elections-tab>
    <elections-tab 
        tabtitle="Network Officers" 
        posts="International Officer | First Generation Officer | People of Colour Officer | Women's Officer"  
        combineresults="true" 
        type="multiple" >
    </elections-tab>
    <elections-tab 
      tabtitle="NUS Delegates" 
      posts="NUS National Conference Delegate" 
      type="single" 
    ></elections-tab>
    
    <elections-tab tabtitle="Academic" type="grouping" >
      <group-tab 
        active
        tabtitle="MSA" 
        searchterms="MSA"
        regex="MSA - "
        replace=" "
      ></group-tab>
      <group-tab 
        tabtitle="Bioscience Students' Association" 
        searchterms="Bioscience"
        regex="Bioscience Students' Association - "
        replace=" "
        >
      </group-tab>
      <group-tab 
        tabtitle="Law Council" 
        searchterms="Law Council"
        regex="Law Council - "
        replace=" "
        >
      </group-tab>
      <group-tab 
        tabtitle="Dental Student Council" 
        searchterms="Dental"
        regex="Dental"
        replace=" "
        >
      </group-tab>
    </elections-tab>
    </elections-candidates>



  
</body>

</html>
